import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';

import { Flex, Layout } from 'antd';
import Navbar from './Component/Navbar/Navbar';

const { Header, Footer, Sider, Content } = Layout;

function App() {

  return (<>
    <Layout>
      <Header>
        <Navbar></Navbar>
      </Header>
      <Content></Content>
      <Footer></Footer>
    </Layout>
  </>
  );
}
export default App;
